      id: 1,
      title: '从Python开学，构建你的神经网络！',
      desc: '小班辅导，一站式掌握AI红利！立抢限量席位！',
      imgUrl: 'https://oimagec2.ydstatic.com/image?id=-9097724867551114430&product=adpublish&w=300&h=200&sc=0&rm=2&gsb=0&gsbd=60'
